import React, { useState } from 'react';
import Sidebar from './components/Sidebar/Sidebar';
import Home from './pages/Home'; // Your components
import TrainingData from './pages/TrainingData';
import EvaluationData from './pages/EvaluationData';
import AboutModels from './pages/AboutModels';
import DataUsagePrivacy from './pages/DataUsagePrivacy';
import MeetTeam from './pages/MeetTeam';

const App: React.FC = () => {
  const [selectedItem, setSelectedItem] = useState<string>('Home'); // Track selected page

  const menuItems = [
    'Home',
    'Training Data',
    'Evaluation Data',
    'About the Models',
    'Data Usage and Privacy',
    'Meet the Team',
  ];

  const handleSelect = (item: string) => {
    setSelectedItem(item);
  };

  const renderPageContent = () => {
    switch (selectedItem) {
      case 'Home':
        return <Home />;
      case 'Training Data':
        return <TrainingData />;
      case 'Evaluation Data':
        return <EvaluationData />;
      case 'About the Models':
        return <AboutModels />;
      case 'Data Usage and Privacy':
        return <DataUsagePrivacy />;
      case 'Meet the Team':
        return <MeetTeam />;
      default:
        return <Home />;
    }
  };

  return (
    <div style={{ display: 'flex' }}>
      <Sidebar menuItems={menuItems} selectedItem={selectedItem} onSelect={handleSelect} />
      <div style={{ marginLeft: '250px', padding: '20px', flex: 1 }}>
        {renderPageContent()}
      </div>
    </div>
  );
};

export default App;
